import "./Categories.css";

import React from "react";
import NavBar from "./NavBar";
import BottomNav from "./BottomNav";

import img1 from "./assets/categories/historicSitesImg.png";
import img2 from "./assets/categories/bodyRelaxingImg.png";
import img3 from "./assets/categories/religiousSitesImg.png";
import img4 from "./assets/categories/parksAndGardensImg.png";
import img5 from "./assets/categories/outdoorsImg.png";
import img6 from "./assets/categories/museumsImg.png";
import img7 from "./assets/categories/cuisinesImg.png";
import img8 from "./assets/categories/shoppingImg.png";
import img9 from "./assets/categories/funAndGamesImg.png";
import img10 from "./assets/categories/drinksAndDanceImg.png";

function highlightCategory(){
    return
}

function Categories(){
    return (
        <>
        <NavBar page="categories"/>

        <div id="cardsWrapper">
            <div id="cards">
                <div class="card" id="card1">
                    <img class="cardImg2" src={img1} onClick={(e) => e.target.classList.toggle('activeCard')}></img>
                </div>
                <div class="card" id="card2">
                    <img class="cardImg2" src={img2} onClick={(e) => e.target.classList.toggle('activeCard')}></img>
                </div>
                <div class="card" id="card3">
                    <img class="cardImg2" src={img3} onClick={(e) => e.target.classList.toggle('activeCard')}></img>
                </div>
                <div class="card" id="card4">
                    <img class="cardImg2" src={img4} onClick={(e) => e.target.classList.toggle('activeCard')}></img>
                </div>
                <div class="card" id="card5">
                    <img class="cardImg2" src={img5} onClick={(e) => e.target.classList.toggle('activeCard')}></img>
                </div>
                <div class="card" id="card6">
                    <img class="cardImg2" src={img6} onClick={(e) => e.target.classList.toggle('activeCard')}></img>
                </div>
                <div class="card" id="card7">
                    <img class="cardImg2" src={img7} onClick={(e) => e.target.classList.toggle('activeCard')}></img>
                </div>
                <div class="card" id="card8">
                    <img class="cardImg2" src={img8} onClick={(e) => e.target.classList.toggle('activeCard')}></img>
                </div>
                <div class="card" id="card9">
                    <img class="cardImg2" src={img9} onClick={(e) => e.target.classList.toggle('activeCard')}></img>
                </div>
                <div class="card" id="card10">
                    <img class="cardImg2" src={img10} onClick={(e) => e.target.classList.toggle('activeCard')}></img> 
                </div>
            </div>
        </div>

        <BottomNav />
        </>
    );
}

export default Categories;
